import React, { useState, useEffect } from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  SafeAreaView,
  Image,
  Platform,
} from 'react-native';
import { useNavigation } from '@react-navigation/native';
import { Ionicons } from '@expo/vector-icons';
import styles from '../styles-part/AutoAlertActiveScreenStyles';

const AutoAlertActiveScreen = () => {
  const navigation = useNavigation();
  const [timeLeft, setTimeLeft] = useState(30); // 30 seconds countdown
  const [isEmergency, setIsEmergency] = useState(false);

  useEffect(() => {
    const timer = setInterval(() => {
      setTimeLeft((prevTime) => {
        if (prevTime <= 1) {
          clearInterval(timer);
          setIsEmergency(true);
          return 0;
        }
        return prevTime - 1;
      });
    }, 1000);

    return () => clearInterval(timer);
  }, []);

  const formatTime = (seconds) => {
    const mins = Math.floor(seconds / 60);
    const secs = seconds % 60;
    return `${mins}:${secs < 10 ? '0' : ''}${secs}`;
  };

  return (
    <SafeAreaView style={isEmergency ? styles.emergencyContainer : styles.container}>
      {/* Header */}
      <View style={isEmergency ? styles.emergencyHeader : styles.header}>
        <TouchableOpacity
          style={styles.backButton}
          onPress={() => navigation.goBack()}>
          <Ionicons name="arrow-back" size={24} color={isEmergency ? "#FFFFFF" : "#FF3B30"} />
        </TouchableOpacity>
        <View style={styles.logoContainer}>
          <Text style={isEmergency ? styles.emergencyLogoText : styles.logoText}>SafeMitra</Text>
        </View>
      </View>

      <View style={isEmergency ? styles.emergencyContent : styles.content}>
        {/* Alert Header */}
        <View style={styles.alertHeader}>
          <View style={isEmergency ? styles.emergencyAlertIconContainer : styles.alertIconContainer}>
            <Ionicons name="alert-circle" size={40} color={isEmergency ? "#FF3B30" : "#FF3B30"} />
          </View>
          <Text style={isEmergency ? styles.emergencyAlertTitle : styles.alertTitle}>
            Auto Alert Active
          </Text>
          <Text style={isEmergency ? styles.emergencyAlertMessage : styles.alertMessage}>
            {isEmergency 
              ? "Emergency Alert! Your guardians have been notified and help is on the way."
              : "Your location will be shared with guardians if you don't cancel within:"}
          </Text>
        </View>

        {/* Timer */}
        <View style={styles.timerContainer}>
          <View style={isEmergency ? styles.emergencyTimerCircle : styles.timerCircle}>
            <Text style={isEmergency ? styles.emergencyTimerText : styles.timerText}>
              {formatTime(timeLeft)}
            </Text>
          </View>
        </View>

        {isEmergency && (
          <View style={styles.emergencyWarning}>
            <Text style={styles.emergencyWarningText}>
              🚨 EMERGENCY ALERT ACTIVATED 🚨
            </Text>
          </View>
        )}

        {/* Cancel Button */}
        <TouchableOpacity
          style={isEmergency ? styles.emergencyCancelButton : styles.cancelButton}
          onPress={() => navigation.goBack()}>
          <Text style={isEmergency ? styles.emergencyCancelButtonText : styles.cancelButtonText}>
            {isEmergency ? "Acknowledge Emergency" : "Cancel Auto Alert"}
          </Text>
        </TouchableOpacity>

        {/* Status Section */}
        <View style={isEmergency ? styles.emergencyStatusSection : styles.statusSection}>
          <Text style={isEmergency ? styles.emergencyStatusTitle : styles.statusTitle}>
            Status Updates
          </Text>
          <View style={styles.statusItem}>
            <Ionicons
              name="location"
              size={24}
              color={isEmergency ? "#FF3B30" : "#FF3B30"}
              style={styles.statusIcon}
            />
            <Text style={isEmergency ? styles.emergencyStatusText : styles.statusText}>
              {isEmergency ? "Live location being shared with guardians" : "Location tracking active"}
            </Text>
          </View>
          <View style={styles.statusItem}>
            <Ionicons
              name="notifications"
              size={24}
              color={isEmergency ? "#FF3B30" : "#FF3B30"}
              style={styles.statusIcon}
            />
            <Text style={isEmergency ? styles.emergencyStatusText : styles.statusText}>
              {isEmergency ? "Emergency alerts sent to all guardians" : "Guardians will be notified if timer expires"}
            </Text>
          </View>
        </View>
      </View>
    </SafeAreaView>
  );
};

export default AutoAlertActiveScreen;
